  \"2013-03-16T00:37:58.690008\",\n\t\"name\": \"geothermal-resources-of-the-northern-sonoma-valley-area-sonoma-county-california26cfd\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The northern Sonoma Valley area contains
  low-temperature geothermal resources near the lower part of the categorized temperature
  range (20-90C) (68-194u00b0F) that may have the potential for useful development.
  Although the geothermal resources in the northern Sonoma Valley area appear to be
  more modest than those in the central portion of Sonoma Valley, as described by
  Youngs and others (1983), local governments and institutions, private developers,
  and manufacturers in the northern area may be able to utilize the geothermal resources.
  This report and the previous California Division 0f Mines and Geology (CDMG) report
  on the geothermal resources in the central and southern portions of Sonoma Valley
  (Youngs and others, 1983) provide a preliminary overall evaluation of the geothermal
  resources for the entire Sonoma Valley area.  Document available for purchase online
  from CAGS. Category: Open File Report.\",\n\t\"license_title\": null,\n\t\"extras\":
